<template>
	<view class="my-box">
		<hx-navbar :config="config"></hx-navbar>

		<view class="my-author">
			<view class="user-info">
				<image :src="avatar==''?default_avatar:avatar" @tap="setAvatar"></image>
				<view @tap="setName">{{user_name==""?default_name:user_name}}</view>
			</view>
		</view>

		<view class="my-content">
			<view class="recently-play">
				<i class="iconfont icon-ziyuanldpi"></i>
				<text>最近播放</text>
				<i class="iconfont icon-xiangyou"></i>
			</view>
			<view class="my-found">
				<i class="iconfont icon-shoucang"></i>
				<text class="text">我的发现</text>
				<i class="iconfont icon-xiangyou"></i>
			</view>
			<!-- #ifdef MP-WEIXIN -->
			<view class="my-weixincode">
				<i class="iconfont icon-weibiaoti--"></i>
				<text class="text">小程序码</text>
				<i class="iconfont icon-xiangyou"></i>
			</view>
			<!-- #endif -->
		</view>
		
		<view class="my-exit">
			<button type="primary" @tap="exitLogin">退出登录</button>
		</view>
		
		<view class="set-uername-input" v-if="isSetName">
			<input placeholder="修改用户名" @input="bindInput" />
			<button @tap="setUserName">修改</button>
		</view>
		
	</view>
</template>

<script>
import con from '../../../api/navabar-config.js';
export default {
	data() {
		return {
			config: con,
			default_avatar: "https://thirdwx.qlogo.cn/mmopen/vi_32/Q0j4TwGTfTLBxlibEt5F6HTUVuW5sSa1OHcKS7YjWQUXWRJLlXgop63GCryHEL4CnxL8rQNd5zqiayLyHw4lPmhA/132",
			default_name: "幻听",
			avatar: "",
			user_name: "",
			isSetName: false
		};
	},
	onLoad() {
		this.getUserInfo()
	},
	onShow() {
		this.getUserInfo()
	},
	methods: {
		// 退出登录，返回登录页
		exitLogin() {
			// 弹出模态框， 问是否真的退出
			uni.showModal({
				title: "退出",
				content: "是否要退出该账号",
				showCancel: true,
				success: (res) => {
					if (res.confirm) {
						uni.redirectTo({ url:"../../login/login" })
						// 清除 用户信息 和 token
						uni.removeStorageSync('token')
						uni.removeStorageSync('userInfo')
					} else if (res.cancel) {}
				}
			})
		},
		// 设置 用户的头像
		setAvatar() {
			// 1. 将头像传入 云存储中
			uni.chooseImage({
				count: 1,
				sizeType: ['original'],
				success: async (res) => {
					if (res.tempFilePaths.length > 0) {
						// 获取本地文件路径
						let filePath = res.tempFilePaths[0]
						const random_number = Math.round((Math.random()*10)+1)
						const result = await uniCloud.uploadFile({
							filePath: filePath,
							cloudPath: `${random_number}${this.user_name}${random_number}.jpg`
						})
						// 上传云存储成功执行
						if(result.success) {
							this.avatar = result.fileID
							// 将 云存储的图片地址 存储在云数据库中 调用云函数 upload_user_avatar
							uniCloud.callFunction({
								name: 'upload_user_avatar',
								data: {
									token: uni.getStorageSync('token'),
									avatar: this.avatar
								}
							}).then((res) => {
								if(res.result.code === 0) {
									uni.showToast({
										title: "头像设置成功",
										icon: "success",
										mask: true
									})
								}
							})
						}
					}
				}
			})
		},
		// 设置用户名
		setName() {
			this.isSetName = !this.isSetName
		},
		bindInput(e) {
			this.user_name = e.detail.value
		},
		setUserName() {
			uniCloud.callFunction({
				name: 'update_userinfo',
				data: {
					token: uni.getStorageSync('token'),
					name: this.user_name
				}
			}).then((res) => {
				if(res.result.code === 0) {
					uni.showToast({
						title: "用户名修改成功",
						icon: "success",
						mask: true
					})
					this.isSetName = false
				}
			})
		},
		// 获取用户信息
		getUserInfo() {
			// 获取用户信息
			const token = uni.getStorageSync('token')
			uniCloud.callFunction({
				name: 'get_userinfo',
				data: {
					token
				}
			}).then((res) => {
				this.user_name = res.result.userInfo.name
				this.avatar = res.result.userInfo.avatar
			})
		}
	}
};
</script>

